.wrapper-terms {
  .accept-terms {
    margin-top: 15px;

    &__label {
      text-decoration: underline;
      font-size: 14px;
    }
    .control {
      display: block;
      position: relative;
      padding-left: 30px;
      cursor: pointer;
      font-size: 18px;

      input:checked + .control__indicator {
        &:after {
          opacity: 1;
        }
      }
    }
    .control__indicator {
      position: absolute;
      top: 2px;
      left: 0;
      height: 20px;
      width: 20px;
      background: $primary-color;
      &:after {
        opacity: 0;
        content: "";
        left: 8px;
        top: 4px;
        width: 3px;
        height: 8px;
        border: solid black;
        border-width: 0 2px 2px 0;
        transform: rotate(45deg);
        position: absolute;
      }
    }
    input {
      position: absolute;
      z-index: -1;
      opacity: 0;
    }
  }
}
