.wrapper-terms {
  .accept-terms {
    margin-top: 15px;

    &__label {
      text-decoration: underline;
      font-size: 14px;
    }
    .control {
      display: block;
      position: relative;
      padding-left: 30px;
      cursor: pointer;
      font-size: 18px;

      input:checked + .control__indicator {
        &:after {
          opacity: 1;
        }
      }
    }
