      position: absolute;
      top: 2px;
      left: 0;
      height: 20px;
      width: 20px;
      background: $primary-color;
      &:after {
        opacity: 0;
        content: "";
        left: 8px;
        top: 4px;
        width: 3px;
        height: 8px;
        border: solid black;
        border-width: 0 2px 2px 0;
        transform: rotate(45deg);
        position: absolute;
      }
    }
    input {
      position: absolute;
      z-index: -1;
      opacity: 0;
    }
  }
}
